import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <div className='p-4'>
      <span className='justify-right'>
        <Link to={() => navigate('/')}>Home</Link>
        <Link to={() => navigate('/products')}>Products</Link>
        <Link to={() => navigate('/posts')}>Posts</Link>
        <Link to={() => navigate('/about')}>About</Link>
        <Link to={() => navigate('/contact')}>Contact</Link>
      </span>
    </div>
  );
};

export default Navbar;
